/* Загрузка фотографий с превью  - должен вызываться уникально для каждого блока подгрузки фото тк используются id, при вызове ajax-ом должен быть вставлен в каждый блок/окно */
function uploadImg(event) {
    event.preventDefault();
    $("#fileElem").removeClass("active");
    $("#filelist").removeClass("active");
    $(event.target).closest("form").find("#fileElem").addClass("active");
    $(event.target).closest("form").find("#filelist").addClass("active");
    $(event.target).closest("form").find("#fileElem").click();

    return false;
}



function in_array(what, where) {
    for(var i=0; i<where.length; i++)
        if(what == where[i])
            return true;
    return false;
}



function up_link() {
    if ( $(window).height() < $(document).height() ) {
        return false;
    } else
        return true;
}


function handleFiles(files) {

    var list = $("#filelist.active");
    if (!files) {
        alert('Здесь ie9');
    } else {
        for (var i = 0, f; f = files[i]; i++) {


            if( f.size > 7900000) {

                $('.notify-trigger--alert').attr('data-notifyTitle', 'Ошибка')
                    .attr('data-notifyText',  'Размер загружаемого файла превышает 8Мб.')
                    .click();
                return;

            }

            var reader              = new FileReader(),
                original_file_name  = files[i].name;

            reader.onload = (function (f) {
                return function (e) {
                    var li = $("<li></li>");
                    $(list).prepend(li);
                    $(li).append("<img src='" + e.target.result + "'/>");
                    $(li).append("<a href='#' class='remove' data-image-original-name='" + original_file_name + "'></a>");
                    //$(li).append("<a href='#' class='edit'></a>");

                    var images_count = $('ul#filelist li').size();
                    $('.js-attachment-count-list > span').text( images_count );
                    if(images_count > 4 ) {
                        $('.js-attachment-count-list').css({'display': 'block'})
                    }

                };
            })(f);
            reader.readAsDataURL(f);
        }
    }
}

