    /* Общая нотификация */
    $('[data-notifyStyle]').on('click', function(){
        makeNotify($(this));
    });

    function removeNotify(object)
    {
        clearTimeout(window.removeWait);
        window.removeWait = setTimeout(function()
        {
            object.remove();
        }, 500);
    }

    function makeNotify(object)
    {
        var style    = object.attr('data-notifyStyle'),
            duration = object.attr('data-notifyDuration'),
            title    = object.attr('data-notifyTitle'),
            text     = object.attr('data-notifyText'),
            notifyID  = 'notify'+$.now();

        var notifyOuter = $('<div>',
            {
                "class"   : 'notify',
                "id"      : notifyID
            });

        var notifyInner = $('<div>',
            {
                "class"   : 'notify__inner'
            });

        if(object.is('[data-notifyText]'))
        {
            var notifyText = $('<p>',
                {
                    "class" : 'notify__text',
                    html    : text
                });
            notifyInner.prepend(notifyText);
        }

        if(object.is('[data-notifyTitle]'))
        {
            var notifyTitle = $('<p>',
                {
                    "class" : 'notify__title',
                    html    : title
                });
            notifyInner.prepend(notifyTitle);
        }

        notifyOuter.prepend(notifyInner).prependTo('body').addClass('notify--'+style);

        $('.notify').removeClass('is-active');

        clearTimeout(window.activeWait);
        window.activeWait = setTimeout(function()
        {
            notifyOuter.addClass('is-active');
        }, 200);

        if(duration>0)
        {
            clearTimeout(window.durationWait);
            window.durationWait = setTimeout(function()
            {
                notifyOuter.removeClass('is-active');
                removeNotify(notifyOuter);
            }, duration);
        }
    }


