    /* Открытие закрытие попапов, функция запроса ajax */
    (function() {

        var body = $('body');
        var _window = $(window);
        var overlay = $('.js-overlay');

        var popupWrap = $('.js-overlay-wrap');
        var ajaxContainer = $('.js-ajax-container');
        var popupState = false;

        var popupWrapFixed = $('.js-overlay-wrap-fixed');
        var ajaxContainerFixed = $('.js-ajax-container-fixed');
        var popupStateFixed = false;

        var currentPopupWrap;
        var currentAjaxContainer = ajaxContainer;
        var currentActivePopup;

        // open popup triggers
        $(document).on('click', '[data-openajax]', function(e) {
            e.preventDefault();

            console.log( $(this).data('openajax') );

            var openTarget = $(this).data('openajax');
            openPopup(openTarget);
        });

        // close popup triggers
        $(document).on('click','.js-popup-container__close, .js-overlay', closePopup);
        $(window).on('keydown', function(e) {
            if(e.which == 27 && popupState) {
                closePopup();
            }
        });

        // open funcs
        function openPopup(openTarget) {

            if(popupState) {
                clearStdPopup();
            } else {
                closePopup();
            }
            currentActivePopup = openTarget;
            openStdPopup(openTarget);
        }
        function openStdPopup(openTarget) {
            popupState = true;
            popupWrap.fadeIn(300);
            currentAjaxContainer = ajaxContainer;
            /* ajaxContainer.css('top',_window.scrollTop());*/
            getAjax('ajax/' + openTarget + '.html', 'ajax/' + openTarget + '-js.html');
        }

        // close func
        function closePopup() {
            closeStdPopup();
        };
        function closeStdPopup() {
            currentAjaxContainer.html('');
            popupWrap.fadeOut();
            popupState = false;
        }
        function clearStdPopup() {
            currentAjaxContainer.html('');
        }

        // load content
        function getAjax(ajax_path, ajax_path_js) {
            $.ajax({
                url: ajax_path,
                dataType: 'text',
                success: function(data){
                    currentAjaxContainer.append(data);
                    if(ajax_path_js) {
                        getAjaxJs(ajax_path_js);
                    }
                }
            });
        };
        function getAjaxJs(ajax_path) {
            $.ajax({
                url: ajax_path,
                dataType: 'text',
                success: function(data) {
                    ajaxContainer.append(data);
                }
            });
        };
    })();



