    /* Анимация элементов Закрепить при наведении */
    $(function() {




        $(document).on('mouseenter', '.slide-out', function() {
            // Анимация при наведении
            $(this).find('.slide-out__fix')
                .stop(true, false)
                .animate({
                    left: -130
                }, 400);
            $(this).find('.slide-out__fix span')
                .stop(true, false)
                .animate({
                    opacity: 1
                }, 400);
        });

        $(document).on('mouseleave', '.slide-out', function() {
            // Обратная анимация
            $(this).find('.slide-out__fix')
                .stop(true, false)
                .animate({
                    left: -10
                }, 400);
            $(this).find('.slide-out__fix span')
                .stop(true, false)
                .animate({
                    opacity: 0
                }, 400);
        });




        $('body').on('click', '.slide-out', function(event) {
                event.preventDefault();

                if ($(this).find('.slide-out__fix').hasClass('slide-out__fix--pin')) {
                    $(this).find('.slide-out__fix span').html('Закрепить в начале');
                    //      $(this).find('.fa').css('color' , '#fff');
                    $(this).find('.slide-out__fix').removeClass('slide-out__fix--pin');
                }
                else {
                    $(this).find('.slide-out__fix span').html('Закреплено');
                    //      $(this).find('.fa').css('color' , '#333');
                    $(this).find('.slide-out__fix').addClass('slide-out__fix--pin');
                }
            }
        );
    });


