    /* Прогресс бар в модальном окне Парка техники (+ при заполнении новой заявки) */
    $( "#eq__progressbar" ).progressbar({
        value: 0
    });
    $(".eq__val").change(function() {
        var pbVal = 0;
        if ($("#eq__brand").val() && $("#eq__brand").val().length > 0 && $("#eq__brand").val() != 'none') pbVal += 12.5;
        if ($("#eq__type").val() && $("#eq__type").val().length > 0 && $("#eq__type").val() != 'none') pbVal += 12.5;
        if ($("#eq__model").val().length > 0) pbVal += 12.5;
        if ($("#eq__sn").val().length > 0) pbVal += 12.5;
        if ($("#eq__motor").val().length > 0) pbVal += 12.5;
        if ($("#eq__year").val().length > 0) pbVal += 12.5;
        if ($("#eq__unit").val().length > 0) pbVal += 12.5;
        if ($("#filelist_equipment > li").length > 0) pbVal += 12.5;
        $( "#eq__progressbar" ).progressbar( "option", "value", pbVal )
            .children('.eq__progressval').children('i')
            .html(pbVal.toPrecision(3) + '%')
            .css("display", "block");
        $('.eq__progressval').css('margin-left', pbVal.toPrecision(2) + '%');

        /* Регулирование слайдера на шагах заполнения заявки */
        $("#counter-form-fill").roundSlider("option", "value", pbVal);
        /*  */

        if (pbVal <= 33) {
            $('.ui-widget-header').css('background' , '#ff6c08');
            $('.eq__progressval i').removeClass('hundred');
            $('.eq__progressval').css('background-position' , '0 0');

            $('#counter-form-fill .rs-range-color').css('background' , '#ff6c08');
            $('#request-lvl__descr').text('Очень низкий').css('color' , '#ff6c08');
            $('#counter-form-fill .rs-move').css('background-position' , '0 0');
            $('#request-lvl__long_descr').text('К сожалению, заявки такого уровня содержания часто остаются без ответа, из-за трудности их обработки. Добавьте подробностей');

        } else if (pbVal > 33 && pbVal <= 66 ) {
            $('.ui-widget-header').css('background' , '#fec315');
            $('.eq__progressval i').removeClass('hundred');
            $('.eq__progressval').css('background-position' , '0 -15px');

            $('#counter-form-fill .rs-range-color').css('background' , '#fec315');
            $('#request-lvl__descr').text('Средний').css('color' , '#fec315');
            $('#counter-form-fill .rs-move').css('background-position' , '0 -15px');
            $('#request-lvl__long_descr').text('Вы неплохо описали этот этап заявки, но если добавите подробностей, на Вашу заявку быстрее откликнутся');

        } else if (pbVal > 66 && pbVal <= 99) {
            $('.ui-widget-header').css('background' , '#00bea5');
            $('.eq__progressval i').removeClass('hundred');
            $('.eq__progressval').css('background-position' , '0 -30px');

            $('#counter-form-fill .rs-range-color').css('background' , '#00bea5');
            $('#request-lvl__descr').text('Высокий').css('color' , '#00bea5');
            $('#counter-form-fill .rs-move').css('background-position' , '0 -30px');
            $('#request-lvl__long_descr').text('Отлично! Ваша заявка - эталон и образец. У Ваших потенциальных исполнителей есть все исходные данные, для того чтобы наиболее достоверно составить ответ!');

        } else if (pbVal == 100 ) {
            $('.eq__progressval i').addClass('hundred');
        }

        return false;
    });


