    /* Ввод только чисел в input type number*/
    $('input[type=number]').keypress(function(e) {
        e = e || event;

        if (e.ctrlKey || e.altKey || e.metaKey) return;
        var chr = getChar(e);

        if (chr == null) return;

        if (chr < '0' || chr > '9') {
            return false;
        }
    });
