/* Фукнция добавления знака процента в круглый слайдер (шаги заполнения заявки) */
function tooltipVal2(e) {
    return e.value + '%';
}


/* Окончания для круглого слайдера */
function declOfNum(number, titles)
{
    cases = [2, 0, 1, 1, 1, 2];
    return titles[ (number%100>4 && number%100<20)? 2 : cases[(number%10<5)?number%10:5] ];
}


/* функция добавления всех сотрудников по клику "Добавить всех" */
function partnersAddAll(event){
    event.preventDefault();
    $(this).addClass('is-hidden');
    $(this).parent().find('.choosen-partner').removeClass('is-hidden');
}


/* функция для ввода чисел в input*/
function getChar(event) {
    if (event.which == null) {
        if (event.keyCode < 32) return null;
        return String.fromCharCode(event.keyCode) // IE
    }

    if (event.which != 0 && event.charCode != 0) {
        if (event.which < 32) return null;
        return String.fromCharCode(event.which) // остальные
    }
    return null;
}


